import './Expenses.css';
function Expenses(props){
    return(
        <div className="expenses">
        <h2>Let's get started!</h2>
        
        <ExpenseItem title={
                props.expenseTitle
            }
            amount={
                props.amount
            }
            date={
                props.date
            }
        ></ExpenseItem>
       
    </div>
    );
}

export default Expenses;
